import React, { useEffect, useState } from 'react';
import { getTrendingMovies } from 'API/movieApi';
import { Link } from 'react-router-dom';

const Home = () => {
  const [films, setFilms] = useState([]);

  useEffect(() => {
    getTrendingMovies().then(setFilms);
  }, []);

  return (
    <div>
      <h2>Trending today</h2>
      .
    </div>
  );
};

export default Home;
